import React from 'react';

function Home() {
    return (
      <div>
        <MySlider />
        <Footer />
      </div>
    );
  }

  function Pricing() {
    return (
      <div>
        <Footer />
    </div>
    );
  }

  function Feedback() {
    return (
      <div>
        <Navtabs />
        <Rating />
        <Footer />
      </div>
    );
  }

  function Team() {
    return (
      <div>
        <MyTeam />
        <Footer />
      </div>
    );
  }

  function Signin() {
    return (
      <div>
        <LoginForm />
        <Footer />
      </div>
    );
  }
  function Signup() {
    return (
      <div>
        <RegForm />
        <Footer />
      </div>
    );
  }
